column128:
'-J'ai déjà eu une inondation qui a causé bcp de dommage à ma maison et j'ai appris que c'est arrivé à mes parents et à ma tante;
-Lors d'un souper de fondue entre amis, le récipient d'huile est tombé et la table a pris en feu. Le feu a commencé à s'étendre, mais nous avons réussi à maîtriser le feu avec un extincteur. Un de mes amis a vécu un incendie et il a tout perdu - Il en porte encore les séquelles aujourd'hui (PTSD). Un couple d'ami, le frère de la conjointe et un autre ami ont vécu un incendie. Le frère et l'autre ami ont eu des brûlures graves au 3e degré. Le neveu de 3 ans de mon ex (avec qui j'ai séjourné à l'hôpital pour le rassurer) avait été brûlé au 3e degré sur 50% de son corps après qu'il ait joué avec un briquet et que son pyjama ait pris en feu;
-J'ai vécu des agressions physiques et intimidation au primaire et au secondaire. J'en été aussi témoin. J'ai également été agressé physiquement lors d'un concert. Ma petite sœur m'a également attaquée physiquement à l'âge adulte. J'ai été témoin des agressions physiques vers d'autre étudiants avec qui j'allais à l'école;
- J'ai appris que le frère de mon oncle (par alliance) a tué sa femme avec une arme à feu (shotgun) lors d'une dispute conjugale. Les enfants ont du s'enfuir et chercher de l'aide chez leur voisine;
J'ai été agressée sexuellement dans un party. J'étais restée pour dormir, car j'avais trop bu et il m'a violé pendant que je dormais/avait de la difficulté à me réveiller en raison de mon état d'ébriété. J'ai appris que ma soeur jumelle a été violée à l'aide de la drogue du viol;
- J'ai été agressée par une voisine à plusieurs reprises (qui avait 17-18 ans)lorsque j'avais 6 ans. Elle m'a fait des attouchements au niveau de la vulve et me montrait et me demander de me toucher devant elle. J'ai appris que ma mère a subit des attouchements par un homme qd elle était enfant (5 ans) et que mon père a vécu de l'abus sexuel de la part d'un ami à son père pendant plusieurs années du primaire;
J'ai été un bébé très malade qui a nécessité plusieurs chirurgies et un suivi pendant les 5 premières années de ma vie. J'ai également été témoin de ma mère qui eu le syndrome de Guillain-Barré et de ma belle-mère (conjointe à mon père) qui a perdu son combat contre le cancer de l'utérus. 
- J'ai appris soudainement le décès de ma grand-mère paternel puisque sa conjointe nous avait pas informé qu'elle était malade et hospitalisé. C'est l'infirmière qui a trouvé le nom de mon père comme contact d'urgence qui nous a informé du décès.
